import React from 'react';

const ParkedVehicles = (props) => {

      const {vehicleParked, deleteVehicleParked} = props;

      return (
            <div>
                  VEHICLES PARKED
                        {vehicleParked.map((vehicles, index) => {
                              return (
                                    <div>
                                          <img src={vehicles.img}/>
                                          {vehicles.name}
                                          <button
                                                onClick={(e) =>
                                                      deleteVehicleParked(
                                                            vehicles,
                                                            index
                                                      )
                                                }
                                          >
                                                DELETE
                                          </button>
                                    </div>
                              );
                        })}
            </div>
      )
}

export default ParkedVehicles;
